import React from "react";
import "./MyWork.css";
import mywork_data from "./mywork_data";

function MyWork() {
  return (
    <div>
      <div className="mywork">
        <div className="mywork-title">
          <h1>My Latest Work</h1>
          <img src="./img/Crypto.png" alt="Crypto" />
        </div>
        <div className="mywork-container">
          {mywork_data.map((work) => (
            <div key={work.id}>
              <h2>{work.title}</h2>
              <p>{work.description}</p>
              {work.tags && work.tags.map((tag, index) => (
                <span key={index}>{tag}</span>
              ))}
              {work.work_image && <img src={`./img/${work.work_image}`} alt={work.work_title} />}
            </div>
          ))}
        </div>
        <div className="mywork-showmore">
          <p>Show More</p>
          <img
            style={{
              color: "white",
              backgroundColor: "white",
              height: "26px",
              width: "38px",
            }}
            src="./img/arrow.png"
            alt=""
          />
        </div>
      </div>
    </div>
  );
}

export default MyWork;
